    /**
     * Run the database seeds.
     *
     * @return void
     */
    public function run()
    {
        foreach ($this->xp as $dsc => $icon) {
            Stack::create(['tag' => 'XP', 'description' => $dsc, 'icon' => $icon]);
        }
        foreach ($this->lrn as $dsc => $icon) {
            Stack::create(['tag' => 'LRN', 'description' => $dsc, 'icon' => $icon]);
        }
    }

